import React from 'react';
import { Redirect, Link } from 'react-router-dom';
import './navBar.css';

class NavBar extends React.Component{
	constructor(props)
	{
		super(props);
		this.state = {
			id: '',
			profile: false,
			logout: false,
			search: false,
			dash: false
		};
	}

	logoutUser = e => {
        this.setState({logout: true});
	}

	goToProfile = e => {
        this.setState({profile: true});
	}

	goToSearch = e => {
		this.setState({search: true});
	}
	goToDashBoard = e => {
		this.setState({dash: true});
	}


	render(){
		return <>

		<nav className="navbar navbar-expand-lg navbar-light bg-primary">
			<a className="navbar-brand" href="" onClick = {this.goToDashBoard}>NOverdose</a>
			{this.state.dash  && <Redirect to={'/mainPage/' + this.props.id}></Redirect>}
			<div className="collapse navbar-collapse" id="navbarNavAltMarkup">
				<div className="navbar-nav">
				<a className = "text-white float-right" href="" onClick = {this.goToDashBoard}>Home</a>
				{this.state.dash  && <Redirect to={'/mainPage/' + this.props.id}></Redirect>}
				<a className = "text-white float-right"href="" onClick = {this.goToProfile}>Profile </a>
				{this.state.profile  &&<Redirect to={'/profile/' + this.props.id}></Redirect>}
				<a className = "text-white float-right" href="" onClick={this.goToSearch}>Search </a>
				{this.state.search  && <Redirect to="/search" /> }
				<a className = "text-white float-right" href = "" onClick = {this.logoutUser}>Logout </a>
				{this.state.logout  && <Redirect to="/login" /> }
				</div>
			</div>
		</nav>
		</>
	}
}
export default NavBar;
